using UnityEngine;

namespace Scripts
{
    [CreateAssetMenu(fileName = "Controller", menuName = "Examples/Controller", order = 1)]
    public class Controller : ScriptableObject
    {
        public string HorizontalAxis;
        public string VerticalAxis;
        public string JumpButton;

        public void Handle(Player player)
        {
            player.AccelerateTo(new Vector2(Input.GetAxis(HorizontalAxis), Input.GetAxis(VerticalAxis)));
            if (Input.GetButtonDown(JumpButton))
            {
                player.Jump();
            }
        }
    }
}
